#include "../matrix_lib/matrix_lib.h"
#include <gtest/gtest.h>

TEST(TestTranspose, basic) {
    matrix_lib::Matrix left;
    matrix_lib::Matrix result;

    left = matrix_lib::Matrix{{-12, 18},
                              {-33, 44}};
    result = matrix_lib::Matrix{{-12, -33},
                                {18,  44}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{-31, -13},
                              {29,  -47}};
    result = matrix_lib::Matrix{{-31, 29},
                                {-13, -47}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{-34, 35},
                              {26,  43}};
    result = matrix_lib::Matrix{{-34, 26},
                                {35,  43}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{-40, 6},
                              {-3,  20}};
    result = matrix_lib::Matrix{{-40, -3},
                                {6,   20}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{23, 12},
                              {11, -9}};
    result = matrix_lib::Matrix{{23, 11},
                                {12, -9}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{-45, 44},
                              {42,  37}};
    result = matrix_lib::Matrix{{-45, 42},
                                {44,  37}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{25,  27},
                              {-39, 50}};
    result = matrix_lib::Matrix{{25, -39},
                                {27, 50}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{41, -3},
                              {35, -3}};
    result = matrix_lib::Matrix{{41, 35},
                                {-3, -3}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{-38, 15},
                              {-37, 17}};
    result = matrix_lib::Matrix{{-38, -37},
                                {15,  17}};
    EXPECT_EQ(matrix_lib::transpose(left), result);

    left = matrix_lib::Matrix{{30,  13},
                              {-41, -20}};
    result = matrix_lib::Matrix{{30, -41},
                                {13, -20}};
    EXPECT_EQ(matrix_lib::transpose(left), result);
}

